import axios from 'axios';
import React, { useEffect } from 'react'

const App28 = () => {
    useEffect(() => {
        get_data()
    }, [])

    const get_data = () => {
        axios.get("https://jsonplaceholder.typicode.com/todos").then((res) => {
            console.log(res.data);
            const data = res.data
        }).catch((err) => {
            console.log(err);
        })
    }
    return (
        <>
            <table border={1} align='center'>
                <tr>
                    <th>Task</th>
                    <th>Number</th>
                    <th>Status</th>
                </tr>
                {
                    data?.map((val_, ind_) => {
                        return (
                            <>
                                <tr>
                                    <th>{val_.userId}</th>
                                    <th>{val_.title}</th>
                                </tr>
                            </>
                        )
                    })
                }
            </table>
        </>
    )
}

export default App28
